import React from 'react';
import { BrowserRouter, Route, Switch} from 'react-router-dom';
import StoredPicker from "./StoredPicker";
import App from './App';

const Router = () => (
    <BrowserRouter>
        <Switch>
            <Route exact path="/" component={StoredPicker} />
        </Switch>
    </BrowserRouter>
)

export default Router;
